/* qpsol:(h[327x327,0nz],g[327],a[326x327,1614nz],lba[326],uba[326],lbx[327],ubx[327],x0[327],lam_x0[327],lam_a0[326],q[],p[])->(x[327],cost,lam_a[326],lam_x[327]) */
static int casadi_f10(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  OSQPWorkspace *work=casadi_f10_mem[mem];
  casadi_int i, n, offset;
  /* Set objective */
  if (arg[1]) {
    casadi_copy(arg[1], 327, w);
  } else {
    casadi_clear(w, 327);
  }
  if (osqp_update_lin_cost(work, w)) return 1;
  /* Set bounds */
  if (arg[5]) {
    casadi_copy(arg[5], 327, w);
  } else {
    casadi_fill(w, 327, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 326, w+327);
  } else {
    casadi_fill(w+327, 326, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 327, w+653);
  } else {
    casadi_fill(w+653, 327, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 326, w+980);
  } else {
    casadi_fill(w+980, 326, casadi_inf);
  }
  if (osqp_update_bounds(work, w, w+653)) return 1;
  /* Project Hessian */
  casadi_tri_project(arg[0], casadi_s17, w, 0);/* Get constraint matrix */
  offset = 0;
  for (i=0; i< 327; ++i) {
    w[0+offset] = 1;
    offset++;
    n = casadi_s18[i+1]-casadi_s18[i];
    casadi_copy(arg[2]+casadi_s18[i], n, w+offset+0);
    offset+= n;
  }
  /* Pass Hessian and constraint matrices */
  if (osqp_update_P_A(work, w, 0, 0, w+0, 0, 1941)) return 1;
  if (osqp_warm_start_x(work, arg[7])) return 1;
  if (arg[8]) {
    casadi_copy(arg[8], 327, w);
  } else {
    casadi_clear(w, 327);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 326, w+327);
  } else {
    casadi_clear(w+327, 326);
  }
  if (osqp_warm_start_y(work, w)) return 1;
  if (osqp_solve(work)) return 1;
  if (res[1]) casadi_copy(&work->info->obj_val, 1, res[1]);
  if (res[0]) casadi_copy(work->solution->x, 327, res[0]);
  if (res[3]) casadi_copy(work->solution->y, 327, res[3]);
  if (res[2]) casadi_copy(work->solution->y+327, 326, res[2]);
  if (work->info->status_val != OSQP_SOLVED) return 1;
  return 0;
}

